import React from 'react'
import '../../App.css'
import ProjectSection from '../ProjectSection';
import { aboutLunarLanguages } from './Data';

export default function Services() {
    return (
        <>
            <ProjectSection {...aboutLunarLanguages} />
            <ProjectSection {...locationTracking} />
            <ProjectSection {...hotspots} />
            <ProjectSection {...practiceMode} />
            <ProjectSection {...userInformation} />
            <ProjectSection {...development} />
            <ProjectSection {...personalRole} />
        </>
    )
}
